'''Mission reports''' are three different items, all used in the [[Cold War]] quest. They are:
*[[Mission report (Ardougne)]], given to the player by a [[Penguin (Cold War)|Penguin]] in [[Ardougne Zoo]] after greeting him.
*[[Mission report (Lumbridge)]], given to the player by the [[Sheep (penguins)|penguins dressed as a sheep]] after giving them the secret phrase.
*[[Mission report (Fake)]], given to the player by [[Noodle]] after trading him [[swamp tar]] and 5 [[feather]]s.

